import React, { Component } from 'react';
import User from '../../models/User';


interface usersState {
    allUsers : User[];
    filteredUsers : User[];
}

export default class Home extends Component <any, usersState>  {

    constructor(props : any) {
        super(props);

    
        this.state = {
            allUsers: new Array <User> (),
            filteredUsers : new Array <User> ()
        };
    }

    componentDidMount = async () => {
        const mockArray = new Array <User> ();
        for (let i = 0; i < 15; i ++) {
            const newUser = new User("ben", 23, "male", true);
            mockArray.push(newUser);
        }

        this.setState({
            allUsers: mockArray
        })
    }


    render() {
        return (
            <div>
                {this.state.allUsers.map( (user, index) => {
                    <div key={index}>
                        <p>{user.name}</p>
                        <p>{user.age}</p>
                        <p>{user.gender}</p>
                        <p>{user.active}</p>
                    </div>
                })}
            </div>
        )
    }
}
